  false,\n\t\"url\": null,\n\t\"notes\": \"Wave data collected in the Gulf of Mexico
  from 09 April 1992 to 03 October 1994. The data were collected by Texas A&M University
  (TAMU) as part of the Texas-Louisiana Shelf Circulation and Transport Processes
  Study (LATEX A). This package contains MiniSpec directional wave data and SeaData
  non-directional wave data from five sites. This is burst data from which all wave
  information can be derived. The wave data project reports are also included on this
  disc.nnCopies of these discs are currently available via the NODC Online Store at
  https://nes.ncdc.noaa.gov/plnes/plsql/olstore.prodspecific?prodnum=5527nnSoftware
  that was developed or provided with this NODC Standard Product may be included in
  the disc_image/ directory as part of the disc image, but all software that was developed
